import React from 'react';
import { BrowserRouter as Route, Switch, withRouter } from 'react-router-dom';

import Home from './Components/Home/Home';

const routes = [
	{
		path: '/',
		exact: true,
		component: () => <Home history={history} />
	},
	{
		path: '/bubblegum',
		component: () => <h2>Bubblegum</h2>
	},
	{
		path: '/shoelaces',
		component: () => <h2>Shoelaces</h2>
	}
];

const SidebarExample = ({ location }) => {
	const currentKey = location.pathname.split('/')[1] || '/';
	const timeout = { enter: 500, exit: 500 };
	return (
		<div>
			<Switch location={location}>
				<Route path={'/'} component={Home} />
				{/* {routes.map((route, index) => (
					<Route key={index} path={route.path} exact={route.exact} component={route.component} />
				))} */}
			</Switch>
		</div>
	);
};

export default withRouter(SidebarExample);
